import { IonButton, IonContent, IonFooter, IonHeader, IonImg, IonCheckbox, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import { useHistory } from 'react-router-dom';
import './Lluvia.css';
import { ReactSVG } from 'react-svg';

import Lluvia from '../imagenes/titulolluvia.svg';
import Volver from '../imagenes/volver.svg'

function Home () {

  return (
    <IonPage>

        <IonHeader className='fondoLluvia'>
          <IonToolbar className='fondoLluvia'>
            <ReactSVG src={Lluvia}></ReactSVG>
          </IonToolbar>
        </IonHeader>


      <IonContent fullscreen className='fondo'>

        <h2 className='texto'>Con nuestra función de control basada en la lluvia, puedes decidir cómo quieres que tus dispositivos respondan cuando detecten lluvia.</h2>
        <IonCheckbox className='checkbox'>Cerrar en caso de lluvia</IonCheckbox>
        <ReactSVG src={Volver} className='imgAtras2' onClick={back}></ReactSVG>

      </IonContent>
    </IonPage>
  );
};

export default Home;
